- input: "TEXT\x1CC00071365\x1CX0\x1C\x1CF3XA\x1CThis amendment includes the following
    changes.  All federal candidates that contributed funds to the DSCC of LA during
    this reporting period are transfers of excess funds and are now so noted.  All
    disbursements for Exempt Mail have been changed to Volunteer Exempt Mail and meet
    FEC regulations for Volunteer Exempt Mail and were not paid with transfer down
    funds from national affiliated committees.  All disbursements for Lapel Stickers
    and Yard Signs were not paid with transfer down funds from national affiliated
    committees.  All disbursements for volunteer exempt mail have been changed to
    line 30b and meet FEC regulations for Volunteer Exempt Mail.  All disbursements
    for Slate Card Distribution on line 21b meet FEC regulations to be on line 21b.
    \ These slate cards included at least 3 candidates (names and party only) and
    included no persuasion message or biographical data.  All disbursements that are
    reported administrative are administrative and are not in connection with a federal
    candidate or election.  Salaries paid on the administrative split are for employees
    who spend less than 25% of their work hours on federal election activity. All
    payments for payroll, payroll taxes and insurance that are reported as administrative
    are not paid on behalf of employees who spend more than 25% of there work time
    on federal election activity.   Salaries reported on line 21b are for employees
    who spend less than 25% of their work hours on federal election activity. All
    payments for payroll, payroll taxes and insurance that are reported on line 21b
    are not paid on behalf of employees who spend more than 25% of there work time
    on federal election activity.  Please note the Louisiana Democratic Party owns
    it own building and therefore does not make regular rent payments."
